# 初始化變數sex，0表示男性，1表示女性
sex = 0

# 更新按鈕文字的函數
def toggle_sex():
    global sex
    if sex == 0:
        sex = 1
        btn_sex.config(text="女性")
    else:
        sex = 0
        btn_sex.config(text="男性")

# 創建按鈕並設置初始文字，使用place()放置在指定的x, y位置
